data.text:
@CNN Former FDA chief Dr. Scott Gottlieb said Monday that Covid vaccines should be available to all adult Americans in April.  

By end of March "possibly 250 million doses sent to States."

Many States have already returned to work and school.  Iowa opened schools in Sept.

